  <style>
    body {
      margin: 0;
      background: #000;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
    }
    .player-wrapper {
      width: 100%;
      max-width: 600px;
    }
    video {
      width: 100%;
      display: block;
    }
    .custom-controls {
      display: flex;
      flex-wrap: wrap;
      justify-content: space-around;
      padding: 10px;
      background: #111;
    }
    .custom-btn {
      flex: 1 1 30%;
      margin: 5px;
      border: none;
      font-size: 24px;
      padding: 12px;
      border-radius: 8px;
      color: #fff;
      background: linear-gradient(45deg, #ff416c, #ff4b2b);
      cursor: pointer;
    }
    .custom-btn:active {
      opacity: 0.7;
    }
    .blue-gradient {
      background: linear-gradient(45deg, #11998e, #38ef7d);
    }
    .purple-gradient {
      background: linear-gradient(45deg, #7F00FF, #E100FF);
    }
    .orange-gradient {
      background: linear-gradient(45deg, #ff8008, #ffc837);
    }
    .pink-gradient {
      background: linear-gradient(45deg, #ff4b2b, #ff416c);
    }
    .navy-gradient {
      background: linear-gradient(45deg, #1e3c72, #2a5298);
    }
  </style>

<body>

  <div class="player-wrapper">
    <video id="player" controls playsinline></video>

    <div class="custom-controls">
      <button class="custom-btn purple-gradient" id="play"><i class="fas fa-play"></i></button>
      <button class="custom-btn navy-gradient" id="fullscreen"><i class="fas fa-expand"></i></button>
      <button class="custom-btn pink-gradient" id="reload"><i class="fas fa-undo-alt"></i></button>
      <button class="custom-btn orange-gradient" id="rewind"><i class="fas fa-undo"></i> 5</button>
      <button class="custom-btn orange-gradient" id="forward"><i class="fas fa-redo"></i> 5</button>
      <button class="custom-btn purple-gradient" id="mute"><i class="fas fa-volume-mute"></i></button>
    </div>
  </div>
